import React from "react";

export class States extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      united: false,
    };
  }

  setUnited = () => {
    this.setState({ united: !this.state.united });
  };

  render() {
    return <div className="status" />
          {}

  }
}
